import React, { useState } from 'react';
import { GithubOutlined, LinkedinFilled } from '@ant-design/icons';
import { Anchor, Drawer, Button, ConfigProvider } from 'antd';
import "./header.css"
const { Link } = Anchor;

function AppHeader() {

  return (
    <ConfigProvider
      theme={{
        token: {
          colorText:'#d818ff',
          colorPrimary: '#d818ff;', // Örnek bir renk tokenı
          fontSize: '16px', // Örnek bir font büyüklüğü tokenı
          spacing: '8px', // Örnek bir boşluk tokenı
          lineHeight:'1.5'
          // Diğer global tokenlar buraya eklenebilir
        },
        components:{
          linkPaddingBlock:'50',

        }
      }}
    >
      <div className="container-fluid">
        <div className="header">

          <Anchor targetOffset="65" className='ant-anchor-wrapper'>
            <Link href="#banner" title="Home" />
            <Link href="#feature" title="Skills" />

            <Link href="#hero" title="Project" />
            <Link href="#contact" title="Contact" />
          </Anchor>
        </div>
      </div>
    </ConfigProvider>
  );
}

export default AppHeader;
